import React from 'react';
import '../../src/Style/services.css'

const Services = ()=>{
    
    return(


        <div>
            <div class="personal-loan">
                <h3>personal loan</h3>
                  
            </div>
            <div class="bike-loan">
                <h3>bike loan</h3>
                
            </div>
            <div class="car-loan">
                <h3>car loan</h3>
                
            </div>
            <div class="home-loan">
                <h3>home loan</h3>
                
            </div>

        </div>
        

    );

};

export default Services;
